import * as S from './bloggy.styles';
import * as GS from '../../styles/global';
import Link from 'next/link';

const Bloggy = ({ posts }) => {
	console.log(posts);
	return (
		<S.BlogContainer>
			<div>
				{posts.map((post) => {
					<div key={post.excerpt}>
						{post.featured_image}
						{post.title}
						{post.excerpt}
					</div>;
				})}
			</div>
			<div>Right</div>
		</S.BlogContainer>
	);
};

export default Bloggy;
